import React, {useEffect} from 'react';
import {useSelector} from "react-redux";
import {actionRefreshHistory, startHistory} from "../../actions/history";
import {store} from "../../store";


const History = () => {

    const history = useSelector(state=>state.app.history);
    // console.log(history);

    // actionRefreshHistory();

    useEffect(()=>{
        store.dispatch(()=>{startHistory()});
    },[])

    return (
        <div>
            <table>
                <thead className={"text-center border border-secondary"}>
                    <th>â„–</th>
                    <th>Kind</th>
                    <th>Amount of answers is right</th>
                    <th>Amount of answers</th>
                    <th>Percentage of answers is right </th>
                    <th>Date</th>
                </thead>
            {
                history.map((item,index)=>{
                    return (
                        <tr className={"text-center border border-secondary"}>
                            <td>{index+1}</td>
                            <td>{item.kind}</td>
                            <td>{item.rightAnswers}</td>
                            <td>{item.totalAnswers}</td>
                            <td>{item.result}%</td>
                            <td>{item.date}</td>
                        </tr>
                    )
                })
            }
            </table>
        </div>
    );
};

export default History;
